*, ::before, ::after {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

html, body {
    width: 100%;
    font-family: 'montserrat', sans-serif;
    background-color: #f4f4f4;
    color: #141414;
    position: relative;
    display: flex;
    justify-content: center;
    overflow-x: hidden;
}

    .GroundZero {
        width: 100%;
        max-width: 1920px;
        display: flex;
        justify-content: center;
        position: relative;
    }

        .Content_Wrap {
            width: 70%;
            margin: 100px 0px;
            margin-bottom: 87vh;
            z-index: 20;
            position: relative;
        }

a {
