// NAV ------------------------------------

.Header {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    margin: 0 auto;
    width: 100%;
    max-width: 1920px;
    height: 170px;
    display: flex;
    justify-content: space-between;
    align-items: center;
    padding: 0 80px;
    z-index: 1000;
    transition: all 1s ease-in;
    transition: opacity ease-in;
}
    .nav-up {
    top: -40px;
    }

    .MobileHeader {
        z-index: 1003;
        display: none;
        opacity: 1;
        transition: opacity;
    }

    .SiteLogo {
        height: 100%;
        font-size: 24px;
        font-family: uppercut-angle, sans-serif;
        font-weight: 400;
        font-style: normal;
        display: flex;
        justify-content: center;
        align-items: center;
        white-space: nowrap;
    }
        .MobileSiteLogo {
            color: #FFF;
        }

    .Header_Nav {
        display: flex;
        align-items: center;
        justify-content: space-between;
    }

        .Nav_Link {
            font-size: 20px;
            margin-right: 55px;
            font-weight: 500;
            transition: color .3s ease-in;
        }
            .Nav_Link:last-child {
                margin: 0;
            }

            .Nav_Link:hover {
                color: #0700ff;
            }

            .Nav_Link-ActivePage {
                color: #0700ff;
            }

    .MobileMenuIcon {
        width: 40px;
        height: 13px;
        display: none;
        flex-direction: column;
        align-items: center;
        justify-content: space-between;
        cursor: pointer;
    }
        .MobileMenuIcon-Active {
            width: 32px;
            justify-content: center;
            position: relative;
        }

        .MenuIconBar {
            width: 100%;
            height: 2px;
            background-color: #141414;
        }
            .Mobile-MenuIconBar1 {
                background-color: #FFF;
                transform:rotate(45deg);
                position: absolute;
            }
            .Mobile-MenuIconBar2 {
                background-color: #FFF;
                transform:rotate(-45deg);
                position: absolute;
            }

@media screen and (max-width: 1600px){
    .Header {
        height: 120px;
    }
    .SiteLogo {
        font-size: 20px;
    }
    .Nav_Link {
        font-size: 16px;
    }
}

@media screen and (max-width: 1100px){
    .Header_Nav {
        display: none;
    }
    .MobileMenuIcon {
        display: flex;
    }
}

@media screen and (max-width: 700px){
    .Header {
        height: 90px;
        padding: 0 30px;
    }
}

