// MOBILE NAV ------------------------------------
.MobileNav {
    width: 100%;
    height: 100%;
    background-color: #0700ff;
    position: fixed;
    z-index: 1002;
    display: none;
    opacity: 1;
    transition: opacity;
}

    .MobileNav_Wrap {
        width: 100%;
        height: 100%;
        position: relative;
        padding-left: 80px;
        padding-top: 80px;
        display: flex;
        align-items: center;
        transition: all .3s ease-in;
    }

        .MobileNav_Links {
            display: flex;
            flex-direction: column;
        }

            .MobileNav_ListItem {
                margin-bottom: 25px;

            }

            .MobileNav_link {
                font-size: 60px;
                font-weight: 900;
                color: #FFF;
                transition: font-size .3s ease-in;
            }
                .MobileNav_link:last-child {
                    margin-bottom: 0;
                }

@media screen and (max-width: 700px){
    .MobileNav_Wrap {
        padding-left: 30px;
    }
}

@media screen and (max-width: 500px){
    .MobileNav_Wrap {
        padding-top: 60px;
    }
    .MobileNav_link {
        font-size: 50px;
    }
}

@media screen and (max-height: 700px){
