// FOOTER ------------------------------------
.Footer {
    position: absolute;
    bottom: 0;
    left: 0;
    right: 0;
    width: 100%;
    height: 87vh;
    overflow: hidden;
    z-index: 1001;
}

    .Footer_Wrap {
        width: 100%;
        height: 100%;
        position: relative;
    }

        .Footer_Background {
            position: absolute;
            width: 100%;
            height: 100%;
            bottom: -100%;
            background-color: #0700ff;
            z-index: 2;
            transition: bottom .8s ease-in;
        }

        .Footer_Constants-LeftFixed {
            position: absolute;
            height: 100%;
            width: 80px;
            left: 0;
            top: 0;
            bottom: 0;
            z-index: 3;
        }

            .Footer_Constants-LeftFixedWrap {
                width: 100%;
                height: 100%;
                padding: 60px 0;
                position: relative;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: flex-end;
            }

                .Footer_Constants-LeftFixed-AddressWrap {
                transform: rotate(-90deg);
                white-space: nowrap;
                }

                .Footer_Constants-LeftFixed-Address {
                    font-size: 11px;
                    font-weight: 500;
                    letter-spacing: 1px;
                    text-transform: uppercase;
                    color: #FFF;
                }

                .Footer_Constants-LeftFixed-Socials {
                    margin-top: 270px;
                }

                    .Social1 {
                        margin-bottom: 20px; 
                    }

        .Footer_Content {
            position: absolute;
            width: 100%;
            height: 100%;
            padding: 100px 250px;
        }

            .Footer_Content-Wrap {
                width: 100%;
                height: 100%;
                position: relative;
            }
                //Plain
                .Footer_Content-Plain {
                    position: absolute;
                    width: 100%;
                    height: 100%;
                    z-index: 1;
                    display: flex;
                }

                    .Footer_Content-Connect {
                        width: 50%;
                        display: flex;
                        flex-direction: column;
                        justify-content: space-between;
                        position: relative;
                    }

                        .Footer_Content-Connect-Header {
                            width: 100%;
                        }

                            .Footer_Content-Connect-Header-Text {
                                font-size: 95px;
                                font-weight: 700;
                                white-space: nowrap;
                                margin-bottom: 20px;
                                transition: font-size .4s ease-in;
                            }

                            .Footer_Content-Connect-Header-Arrow {
                                width: 70px;
                                margin-left: 10px;
                            }

                        .Footer_Content-Connect-Email {
                            position: absolute;
                            bottom: 0;
                            left: 0;
                            font-size: 18px;
                            font-weight: 500;
                            transition: font-size .4s ease-in;
                        }
                .Footer_Content-Right {
                    display: flex;
                    width: 50%;
                    padding-top: 30px;
                }
                    .Footer_Content-Menu {
                        width: 50%;
                    }

                        .Footer_Content-Menu-Title {
                            font-size: 22px;
                            font-weight: 500;
                            margin-bottom: 50px;
                            transition: font-size .4s ease-in;
                        }

                            .Footer_Content-Menu-List {

                            }

                                .Footer_Content-Menu-List-Item {
                                    margin-bottom: 30px;
                                }

                                    .Footer_Content-Menu-List-Link {
                                        font-size: 18px;
                                        font-weight: 500;
                                        color: #65665B;
                                        transition: font-size .4s ease-in;
                                    }
                                        .Footer_Content-Menu-List-Link:hover {
                                            color: #141414;
                                        }

                    .Footer_Content-Location {
                        width: 50%;
                    }

                        .Footer_Content-Location-Title {
                            font-size: 22px;
                            font-weight: 500;
                            margin-bottom: 50px;
                            transition: font-size .4s ease-in;
                        }

                            .Footer_Content-Location-Address {
                                font-size: 18px;
                                font-weight: 500;
                                color: #65665B;
                                margin-bottom: 30px;
                                transition: font-size .4s ease-in;
                            }

                            .Footer_Content-Connect-Email-Mobile {
                                font-size: 18px;
                                font-weight: 500;
                                transition: font-size .4s ease-in;
                                display: none;
                            }




                //White
                .Footer_Content-White {
                    position: absolute;
                    width: 100%;
                    height: 100%;
                    z-index: 4;
                    display: flex;
                    opacity: 0;
                    transition: opacity .6s ease-in;
                    transition-delay: .5s;
                }
                    .Footer_Color-White {
                        color: #FFF;
                    }




