// CONSTANTS ------------------------------------
    .Constants {
        width: 100%;
        height: 100%;
        position: fixed;
        z-index: 10;
    }

        //Fixed Left --------
        .Constants_LeftFixed {
            width: 80px;
            height: 100%;
            position: fixed;
            top: 0;
            left: 0;
            bottom: 0;
        }

            .Constants_LeftFixedWrap {
                width: 100%;
                height: 100%;
                padding: 60px 0;
                position: relative;
                display: flex;
                flex-direction: column;
                align-items: center;
                justify-content: flex-end;
            }

            .Constants_LeftFixed-AddressWrap {
                transform: rotate(-90deg);
                white-space: nowrap;
            }

                .Constants_LeftFixed-Address {
                    font-size: 11px;
                    font-weight: 500;
                    letter-spacing: 1px;
                    text-transform: uppercase;
                }

            .Constants_LeftFixed-Socials {
                margin-top: 270px;
            }

                .Social1 {
                    margin-bottom: 20px; 
                }

        //Center Logo
        .Constants-Logo {
            font-size: 60px;
            font-family: uppercut-angle, sans-serif;
            font-weight: 400;
            font-style: normal;
            color: rgb(255, 255, 255);
            white-space: nowrap;
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            transition: font-size .4s ease-in;
        }

        //Connect Icon
        .Constants-ConnectIcon {
            width: 60px;
            height: 60px;
            background-color: #0700ff;
            position: fixed;
            bottom: 60px;
            right: 50px;
            display: flex;
            justify-content: center;
            align-items: center;
            box-shadow: 5px 5px 10px rgba(22, 53, 252, 0.2);
            cursor: pointer;
            z-index: 999;
            transition: padding-top;
        }
            .ConnectIconBG {
                background-color: transparent;
                box-shadow: none;
            }
            #ConnectIconWhite{

            }
            #ConnectIconBlue{
                display: none;
            }

